import React from "react";
import { SvgIcon } from "@mui/material";
import PersonOutlineOutlinedIcon from "@mui/icons-material/PersonOutlineOutlined";
import PeopleAltOutlinedIcon from "@mui/icons-material/PeopleAltOutlined";
import AppsOutlinedIcon from "@mui/icons-material/AppsOutlined";
import ChevronLeftIcon from "@mui/icons-material/ChevronLeft";
import LightModeOutlinedIcon from "@mui/icons-material/LightModeOutlined";
import DarkModeOutlinedIcon from "@mui/icons-material/DarkModeOutlined";
import CloseOutlinedIcon from "@mui/icons-material/CloseOutlined";
import AdminPanelSettingsOutlinedIcon from "@mui/icons-material/AdminPanelSettingsOutlined";
import LibraryBooksOutlinedIcon from "@mui/icons-material/LibraryBooksOutlined";

export const User = ({ color, size }) => {
  return <PersonOutlineOutlinedIcon color={color} fontSize={size} />;
};

export const Group = ({ color, size }) => {
  return <PeopleAltOutlinedIcon color={color} fontSize={size} />;
};

export const Apps = ({ color, size }) => {
  return <AppsOutlinedIcon color={color} fontSize={size} />;
};

export const Back = ({ color, size }) => {
  return <ChevronLeftIcon color={color} fontSize={size} />;
};

export const LightMode = ({ color, size }) => {
  return <LightModeOutlinedIcon color={color} fontSize={size} />;
};

export const DarkMode = ({ color, size }) => {
  return <DarkModeOutlinedIcon color={color} fontSize={size} />;
};

export const Role = ({ color, size }) => {
  return <AdminPanelSettingsOutlinedIcon color={color} fontSize={size} />;
};

export const Default = ({ color, size }) => {
  return <LibraryBooksOutlinedIcon color={color} fontSize={size} />;
};

export const Close = ({ color }) => {
  return <CloseOutlinedIcon color={color} />;
};

export const ResourceTypeIcon = ({ resourceTrait = 0, color, size }) => {
  switch (resourceTrait) {
    case 1:
      return <User color={color} size={size} />;
    case 2:
      return <Group color={color} size={size} />;
    case 3:
      return <Role color={color} size={size} />;
    case 4:
      return <Apps color={color} size={size} />;
    default:
      return <Default color={color} size={size} />;
  }
};

